snippet.textDisplay:
@Carlos Diaz  te vuelves a equivocar 
No es solo el sector inmobiliario pero si es el principal seguido por 2 años de pandemia,  de eso se derivo la subida de precios en los combustibles fósiles, Que claro al gobierno le facina la idea de que los combustibles sigan con los precios altos como el primer productor de petróleo le encanta la idea pero a nosotros No,,,,, y al último con un porcentaje muy pequeño la cadena de suministro...
Y lo sé por qué soy de USA...

